style.css:
@-moz-document domain("youtube.com") {

/********************************/
 /*PokeTube Hoenn by YAD*/
/********************************/
	
body {
    font-family: YADretroFont!important;
	cursor: url("/*[[yadcursor]]*/"), auto;
}

/*option*/
tp-yt-paper-listbox {
    background: #ef7d21;
}
tp-yt-paper-listbox.yt-dropdown-menu {
    background-color: #ef7d21;
	
}
tp-yt-paper-listbox.yt-dropdown-menu tp-yt-paper-item.yt-dropdown-menu {
    font-weight: inherit;
    background-color: #e9ab78;;
}

tp-yt-paper-listbox.yt-dropdown-menu tp-yt-paper-item.yt-dropdown-menu:hover {
    background-color: #27c9d5;
}	
	tp-yt-paper-menu-button[vertical-align="top"] .dropdown-content.tp-yt-paper-menu-button {
    box-shadow: 0px 0px 0px 2px #856142;
}

	ytd-menu-popup-renderer {
    background-color: #fff0;
    border-radius: 11px!important;
	box-shadow: 0px 0px 0px 3px #554242!important;
}
	
yt-icon.ytd-topbar-logo-renderer {/*logo*/
    animation-name: logoyad;
	filter: none;
    animation-duration: 0.8s;
    animation-iteration-count: 1;
	fill-opacity: 0;
    background-image: url("/*[[logoniyad]]*/");
    background-position: center;
    background-size: 100%;
    background-repeat: no-repeat;
    width: 100%;
    height: 50px;
    max-width: 100px;
    max-height: 100px;
		
}

/*country*/	
#country-code.ytd-topbar-logo-renderer {
    color: #fff;
    margin: 7px 0px 0px 2px;
}

/*trial dia*/
tp-yt-paper-dialog {
    background: #90d5ca;
    color: aliceblue!important;
    box-shadow: 0px 0px 0px 3px #554949!important;
    border-radius: 13px;
}

.ytd-topbar-logo-renderer:not(:active) {
	animation-name: logoyad;
    animation-duration: 0.8s;
    animation-iteration-count: 1;
}

@keyframes logoyad {
   0% {transform: scalex(0)}
  25% {transform: scaleY(0.1)}
  50% {transform: scalex(0.7)}
  75% {transform: scaleY(0.15)}
	
}

/*playlist*/
ytd-browse[page-subtype=playlist] {
    background-color: #f1f1f100;
}

/**playlist page**/
ytd-playlist-sidebar-renderer {
    background-color: #fff0;
}
ytd-browse[page-subtype=playlist] ytd-two-column-browse-results-renderer.ytd-browse {
    background-color: #fff0;
}
#container.ytd-playlist-panel-renderer {
    border: 1px solid #27c9d5;
    box-shadow: 0px 0px 0px 3px #554242;
}
.header.ytd-playlist-panel-renderer {
    background-color: #90d5ca;
	border: 2px solid #fff
}
.playlist-items.ytd-playlist-panel-renderer {
    background-color: #fffde0;
}

html:not(.style-scope)[dark], :not(.style-scope)[dark] {
    background:url(https://i.ibb.co/jvT9xWK/topbar.png),url(https://i.ibb.co/rp3hpCP/topbar2.png), #f0f098;
	background-position-x: -15%, -4%;
	background-repeat: no-repeat;
	background-size: 440px, 440px;
	border: 0px solid #433c44;
	box-shadow: inset 0px 0px 0px 4px #433c44;
	animation: yadtop 1s 1;
}
ytd-masthead {
    background:url(https://i.ibb.co/jvT9xWK/topbar.png),url(https://i.ibb.co/rp3hpCP/topbar2.png), #4fb2ab;
	background-position-x: -15%, -4%;
	background-repeat: no-repeat;
	background-size: 440px, 440px;
	border: 0px solid #433c44;
	border-radius: 0px 0px 10px 10px;
	box-shadow: inset 0px 0px 0px 4px #433c44;
    animation: yadtop2 1s 1;
}
@keyframes yadtop {
	0% {transform: translatey(-65px);background-position-x: -25%, -20%;}
	100% {transform: translatey(0px);}
}

@keyframes yadtop2 {
	0% {transform: translatey(-65px);background-position-x: -25%, -20%;}
	100% {transform: translatey(0px);}
}

/*div#content.style-scope.ytd-app {
    --ytd-masthead-height: inherit;
}*/

#logo-icon-container.ytd-topbar-logo-renderer #youtube-paths.ytd-topbar-logo-renderer path.ytd-topbar-logo-renderer {
    fill: #fff
}
path.style-scope.ytd-topbar-logo-renderer {
    fill: #fd2b84;
}


ytd-rich-grid-media[mini-mode] #video-title.ytd-rich-grid-media {
    text-shadow: 0 1px #a4a4a4;
}

/*watched*/
#progress.ytd-thumbnail-overlay-resume-playback-renderer {
    background-color: #fd2b4e
}

ytd-compact-video-renderer:not([watch-feed-big-thumbs]) ytd-thumbnail.ytd-compact-video-renderer {
    margin-right: 8px;
    height: 94px;
    width: 168px;
}
/*thumbnails outline*/
ytd-thumbnail #thumbnail.ytd-thumbnail {
    box-shadow: 0px 0px 0px 2px #554242;;
}

/*my eyes*/
html:not(.style-scope) {
    --yt-spec-static-brand-red: #17a4c5;
}

ytd-app {  background:url(https://i.ibb.co/hLXVM4K/yadbike.gif),url(/*[[bg]]*/), /*[[yadbgcol]]*/;
	background-attachment: fixed, fixed;
	background-repeat: no-repeat;
	background-size: 9%,cover;
	background-blend-mode: screen;
	background-position: 115% 542px, center;
    --app-drawer-content-container_-_background-color: #b4292900;
	animation: yadgogo2;
	animation-duration: 5s;
	animation-iteration-count: infinite
}
ytd-app:active { background:url(https://i.ibb.co/hLXVM4K/yadbike.gif),url(/*[[bg]]*/), /*[[yadbgcol]]*/;
	background-attachment: fixed;
	background-repeat: no-repeat;
	background-size: 9%,cover;
	background-blend-mode: normal,screen;
	background-position: 115% 542px, center;
    --app-drawer-content-container_-_background-color: #b4292900;
	animation: yadgogo;
	animation-duration: 5s;
	animation-iteration-count: 1
}

ytd-rich-grid-media[mini-mode] #video-title.ytd-rich-grid-media {
    font-size: 16px;
}

.title.ytd-video-primary-info-renderer {
   font-size: 25px;
   color: #332F24!important;
	padding-left: 10px
}

ytd-video-primary-info-renderer {
    --yt-button-icon-size: 36px;
    border: 3px solid #2d5103;
	border-radius: 0px 0px 9px 9px;
    background-color: #f7f6d7;
}
span.ytd-video-view-count-renderer {/*views*/
    color: #fb0;
	font-size: 17px;
	padding-left: 10px
}

ytd-sentiment-bar-renderer {/*like bar*/
    padding-top: 0px;
}
ytd-sentiment-bar-renderer[activated] #like-bar.ytd-sentiment-bar-renderer {
    background-color: #17a4c5;
}	
	
#like-bar.ytd-sentiment-bar-renderer {
    background: #a4a4a4;
}
ytd-toggle-button-renderer.style-default-active[is-icon-button] {
    color: #90d5ca;
	transform: scale(1.2);
        filter: invert(1)
}

/*share save*/
ytd-button-renderer #button.ytd-button-renderer {
    color: #80626c!important;
}

/*survey*/
#star-survey.ytd-inline-survey-renderer {
    background: #FC4446;
    border: 3px solid #373634;
	border-radius: 7px;
}
#subtitle.ytd-inline-survey-renderer {
    color: #fffef8;
}
	#title.ytd-inline-survey-renderer, #follow-up-title.ytd-inline-survey-renderer {
    color: #fffef8;
}
yt-icon.style-scope.ytd-rating-survey-option-renderer {
    color: #ffec61
}
ytd-button-renderer #button.ytd-button-renderer {
    color: #fff;
}
#inline-survey-header.ytd-inline-survey-renderer yt-icon-button.ytd-inline-survey-renderer {
    color: #68252f;
}
#inline-survey-compact-video-renderer.ytd-inline-survey-renderer {
    background-color: #633131;
}
h3.ytd-compact-video-renderer {
    color: #000;
}
#text-container.ytd-channel-name {
    color: #e46392;
}
ytd-inline-survey-renderer[expanded] #dismissible.ytd-inline-survey-renderer {
    background-color: #b94da3;
}
ytd-checkbox-survey-option-renderer.ytd-inline-survey-renderer {
    --paper-checkbox-unchecked-color: #741264;
    --paper-checkbox-label-color: #fdffeb;
    --ytd-checkbox-survey-option-padding: 7px;
    background-color: #3fac7b00;
}
#dismiss-button.ytd-inline-survey-renderer {
    background-color: #b94da3;
    margin: 24px 0;
}
ytd-button-renderer.style-primary[is-paper-button] {
    background-color: #5ca49b;
    color: var(--yt-spec-text-primary-inverse);
}
#dismiss-button.ytd-inline-survey-renderer yt-icon-button.ytd-inline-survey-renderer {
    color: #702929;
}

/*poll*/
tp-yt-paper-item.ytd-backstage-poll-renderer[selected] .progress-bar.ytd-backstage-poll-renderer {
    background-color: var(--yt-live-chat-count-color-early-warning);
}
.text-area.ytd-backstage-poll-renderer {
    color: #ffffff;
}
ytd-backstage-poll-renderer[show-poll-choice-border] tp-yt-paper-item.ytd-backstage-poll-renderer[selected] .choice-info.ytd-backstage-poll-renderer {
    border: 1px solid var(--yt-swatch-primary-darker);
}
yt-icon.checked.ytd-backstage-poll-renderer {
    color: var(--paper-deep-orange-800);
}


/*right col*/

ytd-multi-page-menu-renderer {
    background: #FC4446;
    border: 3px solid #373634;
	border-radius: 7px;
}
ytd-active-account-header-renderer {
    background-color: #943536;
    border-bottom: 3px solid #403333;
}
paper-item.ytd-compact-link-renderer {
    color: #fff;
	text-shadow: 0px 1.5px 0px #3626263d;
	font-family: YADretroFont;
}
tp-yt-paper-item {
    color: #fff!important;
	text-shadow: 0px 1.5px 0px #3626263d;
	font-family: YADretroFont;
}
yt-formatted-string.ytd-account-item-renderer[secondary] {
    color:#7dc3ed;
}
#channel-title.ytd-account-item-renderer {
    color: #fff
}
#label.ytd-compact-link-renderer {
	font-size: 17px!important
}
#label.ytd-toggle-theme-compact-link-renderer {
    font-size: 17px;
    color: beige;
}
yt-formatted-string[has-link-only_]:not([force-default-style]) a.yt-simple-endpoint.yt-formatted-string:visited {
    color: #FFF;
}

#container.ytd-sentiment-bar-renderer {
    height: 5px;
}
#like-bar.ytd-sentiment-bar-renderer {
    height: 5px;
}
.text.ytd-notification-renderer {
    color: #fffef2;
	text-shadow: 0px 1.5px 0px #3626263d;
}
.message.ytd-notification-renderer {
	font-size: 17px
}
ytd-simple-menu-header-renderer {/*notif*/
    background-color: #943536;
    color: #fff;
	border-radius: 4px 4px 0px 0px;
	box-shadow: 0 2px 0px #4b2d2d
}

/*notif number*/
#notification-count.ytd-notification-topbar-button-renderer {
    background-color: #fc036b;
	box-shadow: 0px 0px 0px 2px #7f184b
}

.metadata.ytd-notification-renderer {
    color: #943536;
    font-size: 15px;
}
#account-name.ytd-active-account-header-renderer {
    color: #fff;
    font-size: 17px;
}
yt-icon.ytd-compact-link-renderer {
    color: #373634;/*icon*/
}
yt-icon.ytd-toggle-theme-compact-link-renderer {
    color: #fff;
}

#label.ytd-toggle-theme-compact-link-renderer {
    font-size: 17px;
}
/*manage account*/
yt-formatted-string[ellipsis-truncate] a.yt-formatted-string:last-child {
    color: beige;
}

/*pop up*/
.ytp-popup {
    border-radius: 7px;
    background: #3a86ab;
    text-shadow: 0 0 2px rgba(0,0,0,.5);
    border: 3px solid #202830;
	font-family: YADretroFont!important;
}
.html5-video-info-panel {
    background: #84b559;
    border-radius: 7px;
    color: #fff;
	border: 3px solid #254f1c
}
.ytp-menuitem[aria-checked="true"] .ytp-menuitem-toggle-checkbox {/*setting*/
    background: #ef7d21;
	box-shadow: inset 0px 0px 0px 2px #fff
}
.ytp-menuitem-toggle-checkbox {
    background: #454545;
	box-shadow: inset 0px 0px 0px 2px #f0f0f0
}
.toggle-bar.paper-toggle-button {
    background-color: #454545;
	box-shadow: inset 0px 0px 0px 2px #efefef;
	opacity: 1
}
paper-toggle-button[checked]:not([disabled]) .toggle-bar.paper-toggle-button {
    opacity: 1;
    background-color: #ef7d21;
	box-shadow: inset 0px 0px 0px 2px #fff
}
paper-toggle-button[checked]:not([disabled]) .toggle-button.paper-toggle-button {
    background-color: #fff
}
	
/*pokeball outline*/
#guide-icon.ytd-masthead {
    box-shadow: 0px 0px 0px 6px #433c44;
    border-radius: 44px;
}
/*left coloumn*/
#guide-content.ytd-app {
    background: url(https://i.ibb.co/ZYqY2rq/tiles.png),  #f27f2c;
    border: 0px solid #433c44;
    border-radius: 0px 9px 9px 0px;
	box-shadow: inset 0px 0px 0px 4px #506070;
	background-blend-mode: overlay
}
#guide-section-title.ytd-guide-section-renderer {
    color: #000
}
#sections.ytd-guide-renderer > *.ytd-guide-renderer:not(:last-child) {
    border-bottom: 1px solid #433c44;
    background-color: #7bc09100;
}
#scrim.tp-yt-app-drawer {
    background: #ffd60000;
}   
    
.title.ytd-guide-entry-renderer {
	font-family: YADretroFont!important;
	font-size: 23px;
	text-shadow: 0px 1.5px 0px #dd171700;
	font-variant-caps: all-small-caps;
	color: #F8F8F8;
}
.guide-icon.ytd-guide-entry-renderer {/*icons*/
    color: #fff;
}

#newness-dot.ytd-guide-entry-renderer {
    width: 5px;
    height: 5px;
    border-radius: 50%;
    background-color: #4fb2ab;
    margin: 0 6px;
    display: none;
    box-shadow: 0px 0px 0px 1px #fffef2;
}	
	
.guide-icon.ytd-guide-entry-renderer:hover {/*icons*/
    color: #fff;
	animation: swing 0.1s 10 alternate;
	animation-timing-function: ease-in-out
}
@keyframes swing {
	0% {transform: rotate(120deg)}
	100% {transform: rotate(5deg)}
}


#voice-search-button.ytd-masthead .ytd-masthead[is-icon-button], #buttons.ytd-masthead .ytd-masthead[is-icon-button]:hover {
    color: #de6666;
	background-image: url(https://i.ibb.co/D4QJkBh/tone.png);
    background-repeat: no-repeat;
    background-position: center;
    background-size: 100%;
}

.ytp-scrubber-pull-indicator {/*pika*/
    background-color: #fff0;
    height: 35px;
    width: 45px;
    background-image: url(data:image/gif;base64,), url(data:image/gif;base64,);
    background-repeat: no-repeat;
    background-position: center;
    background-size: 43px,80px;
    bottom: -5px;
    left: -25.5px;
    transform: rotate(0deg);
	transform: scale(1.1);
	border-radius: 30px
}
.html5-scrubber-button, .ytp-scrubber-button {
	transform: rotate(0deg);
}
.ytp-swatch-background-color {/*sliderball*/
    background-color: #fff0;
}

.ad-interrupting .ytp-scrubber-button.ytp-swatch-background-color {
    background-color: #f70000;
}
.ytp-play-progress {
	background: #ffe100a6;
}
.ytp-scrubber-button {
    height: 0px;
    width: 0px;
}
.ytp-progress-list {
    background: #00fcb54d;
}


/*player icons*/



/*post name*/
#author-text.yt-simple-endpoint.ytd-backstage-post-renderer {
    font-size: 20px;
}
#author-text.yt-simple-endpoint.ytd-comment-renderer {
    font-size: 18px;
	color: #f27f2c;
	text-shadow: 0px 0px 0px #beb3b3;
}
#content-text.ytd-comment-renderer {
    font-size: 17px;
	color: #4f2121;
}

/*active*/
ytd-guide-entry-renderer[active] .guide-icon.ytd-guide-entry-renderer {
    color: #f0f098;
}
ytd-guide-entry-renderer[active] .title.ytd-guide-entry-renderer {
    font-size: 25px;
    color: #414141;
}

/*game*/
ytd-rich-metadata-renderer {
    background-color: #f5faf6;
	border: 5px groove #a4a5b6;
	border-radius: 8px
}

.ytp-volume-slider-handle {
    position: absolute;
    top: 50%;
    width: 12px;
    height: 12px;
    border-radius: 6px;
    margin-top: -6px;
    background-color: black;
    background-image: url(data:image/gif;base64,);
    background-repeat: no-repeat;
    background-position: center;
    background-size: 20px;
	box-shadow: 0 0 0px 3px #f50000;
}
.ytp-volume-slider-handle:before {
    left: -58px;
    background: #fcfcfc36;
}

/*volume box*/
.ytp-volume-slider-active .ytp-volume-panel {
    width: 56px;	
}
.ytp-volume-slider-handle:after {
    background: #ffffff38;
}
.ytp-big-mode .ytp-volume-slider-active .ytp-volume-panel {
    width: 81px;
}

