/*live chat*/
yt-formatted-string.ytd-menu-navigation-item-renderer {
    color: #ffffff;
	font-family: YADretroFont;
}
ytd-menu-popup-renderer {
    box-shadow: unset;
}
.ytp-live-badge[disabled]:before {
   animation: livefeed 1s alternate infinite
