/*spinner*/
.ytp-spinner {
	position: absolute;
	left: 50%;
	top: 50%;
	width: 64px;
	margin-left: -32px;
	z-index: 18;
	pointer-events: none
}
.ytp-big-mode .ytp-spinner {
	width: 128px;
	margin-left: -64px
}
.ytp-spinner-message {
	position: absolute;
	left: 50%;
	margin-top: 50%;
	width: 300px;
	font-size: 127%;
	line-height: 182%;
	margin-left: -150px;
	display: none;
	text-align: center;
	background-color: black;
	opacity: .5
}
.ytp-spinner-container {
	pointer-events: none;
	position: absolute;
	width: 100%;
	padding-bottom: 100%;
	top: 50%;
	left: 50%;
	margin-top: -50%;
	margin-left: -50%;
	animation: ytp-spinner-linspin 0.5s linear infinite;
	-webkit-animation: ytp-spinner-linspin 0.5s linear infinite
}
.ytp-spinner-rotator {
	position: absolute;
	width: 100%;
	height: 100%;
	/* -webkit-animation:ytp-spinner-easespin 5332ms cubic-bezier(0.4,0.0,0.2,1) infinite both; */
	animation: ytp-spinner-easespin 5332ms cubic-bezier(0.4, 0.0, 0.2, 1) infinite both;
}
.ytp-spinner-left {
	position: absolute;
	top: 0;
	left: 0;
	bottom: 0;
	overflow: hidden
}
.ytp-spinner-right {
	position: absolute;
	top: 0;
	right: 0;
	bottom: 0;
	overflow: hidden
}
.ytp-spinner-left {
	right: 49%
}
.ytp-spinner-right {
	left: 49%
}
.ytp-spinner-circle {
	box-sizing: border-box;
	position: absolute;
	width: 200%;
	height: 100%;
	border-style: solid;
	border-color: #e206599c #e206599c #ffffff9c #ffffff9c;
	border-radius: 50%;
	border-width: 23px;	
}
.ytp-big-mode .ytp-spinner-circle {
	border-width: 45px
}
.ytp-spinner-left .ytp-spinner-circle {
	left: 0;
	right: -100%;
	border-right-color: transparent;
	-webkit-animation: ytp-spinner-left-spin 1333ms cubic-bezier(0.0, 0.0, 0.0, 0) infinite both;
	animation: ytp-spinner-left-spin 1333ms cubic-bezier(0.0, 0.0, 0.0, 0) infinite both
}
.ytp-spinner-right .ytp-spinner-circle {
	left: -100%;
	right: 0;
	border-left-color: transparent;
	-webkit-animation: ytp-right-spin 1333ms cubic-bezier(0.0, 0.0, 0.0, 0) infinite both;
	animation: ytp-right-spin 1333ms cubic-bezier(0.0, 0.0, 0.0, 0) infinite both
}
@-webkit-keyframes ytp-spinner-linspin {
	to {
		-webkit-transform: rotate(-360deg)
	}
}
@keyframes ytp-spinner-linspin {
	0% {
		transform: rotate(-360deg)
	}
}
@-webkit-keyframes ytp-spinner-easespin {
	0% {
		transform: unset
	}
}
